  false,\n\t\"url\": null,\n\t\"notes\": \"The integrated modeling framework for Antarctic
  krill (Euphausia superba) has been extended to include estimates of krill growth
  consistent with survey data and to use multi-nation survey data collected from 1981
  to 2014 near the Antarctic Peninsula. Four models of the population dynamics of
  Antarctic krill in Subarea 48.1 based on different aggregations of the data are
  described to illustrate the capabilities of the framework.\",\n\t\"license_title\":
